cssString:
div.ui-svg svg{
    color: var(--nr-dashboard-widgetColor);
    fill: currentColor !important;
}
div.ui-svg path {
    fill: inherit;
}

func:
var i;
var area;
var status;
var ocupied = 0;
list_command = [];
for (i = 0; i < msg.payload.rows.length; i++) 
{
    area = msg.payload.rows[i]['no_area'];
    status = msg.payload.rows[i]['status'];

    selector = "#car" + area;
    if (status==true)
    {
        visible = "hidden";
    }
    else
    {
        visible = "visible";
        ocupied = ocupied + 1;
    }

    list_command.push({        
        "command": "set_style",
        "selector": selector,
        "attributeName": "visibility",
        "attributeValue": visible});
}

percentage = Math.round((ocupied / 12) * 100);

list_command.push({        
    "command": "update_text",
    "selector": "#ocupied",
    "textContent": percentage});

msg.payload = list_command;
return msg;
